import React from "react";
import { useNavigate } from "react-router-dom";


const Buttons = () => {

    const navigate = useNavigate();

    const handleEasy = () => {
        const LinkTo = '/easy';
        navigate(LinkTo);

    }

    return (
        <>
        <div className="button"
        onClick={() => handleEasy()}>
            Easy</div></>
    )

}
export default Buttons
